text:
#throwbackthursday
.
"சாத்திரங்கள் பலபல கற்பாராம்;
சவுரியங்கள் பலபல செய்வராம்;
மூத்த பொய்ம்மைகள் யாவும் அழிப்பராம்;
மூடக்கட்டுக்கள் யாவுந் தகர்ப்பராம்;
காத்து மானிடர் செய்கையனைத்தையும்
கடவுளர்க்கினிதாகச் சமைப்பராம்;
ஏத்தி ஆண்மக்கள் போற்றிட வாழ்வராம்;
இளைய நங்கையின் எண்ணங்கள் கேட்டீரோ!" - பாரதி 
